import React, { Component }  from 'react';
import MUIDataTable from "mui-datatables";

const PatientsList = ({data}) => {
  const columns = ["Nombre", "Edad", "Email", "Activo"];

  const options = {
    filterType: 'checkbox',
    rowsPerPage: 5,
    rowsPerPageOptions: [5,10,15],
    textLabels:{
      body: '' //estp pa q cuando esten fetcheando los mensajes, aparezca en blanco el table
    },
    serverSide: true,
      // filterType={'dropdown'}
      // responsive={'stacked'}
      // count={10}
  };  

  return(
    <MUIDataTable
      title={'Pacientes'}
      data={data}
      columns={columns}
      options={options}

      // resizableColumns={true} no funciona
    />
  )
}

export default PatientsList;
